import React, { useState } from "react";

function Form() {
	const [customers, setCustomers] = useState([]);
	useEffect(() => {
		fetch("/").then((res) => {
			setCustomers(res.data);
			console.log(res.data);
		});
	}, []);

	return <div>{customers}</div>;
}

export default Form;
